const isDev = require('electron-is-dev');
var wsProtocol, wsUrl, wsPort;

if (isDev) {
  wsProtocol = process.env.IRON_WS_PROTOCOL;
  wsUrl = process.env.IRON_WS_URL;
  wsPort = parseInt(process.env.IRON_WS_PORT, 10);
// Hack for Prod
// TODO figure out how to do this with config variables...
} else {
  wsProtocol = `wss`;
  wsUrl = `www.ironnotice.com`;
  wsPort = null;
}

exports.config = {wsProtocol: wsProtocol, wsUrl: wsUrl, wsPort: wsPort};
